import { Formik, Form, Field } from 'formik';
import schema from '../../components/validates/schema';
import './style.css';
import Button from '../../components/utils/button';


export default function Register() {


  function onSubmit(values, actions) {

    console.log('SUBMIT', values);

  }
  return (

    <div className={"Principal"}>

    <div>
    <ul>
        <li><a class="active" href="#home">Home</a></li>
        <li><a href="#news">News</a></li>
        <li><a href="#contact">Contact</a></li>
        <li><a href="#about">About</a></li>
      </ul>

    </div>
      
      <Formik

        validationSchema={schema}
        /*validate={validate}*/
        onSubmit={onSubmit}
        initialValues={{
          nome: '',
          email: '',
          cpf: '',
          crm: '',
          specialization: '',
          phoneOne: '',
          phoneTwo: '',
          password: '',
        }}
        render={({ values, errors, isValid }) => (

          <Form className={"divCenter"}>
            <div >
              <label className={"text"}>Nome</label>
              <br></br>
              <Field name="name" type="text" />
              <br></br>
              {errors.nome && (
                <span className={'errors'}>{errors.nome}</span>
              )}
            </div>
            <br></br>
            <div>
              <label className={"text"}>Email</label>
              <br></br>
              <Field name="email" type="text" />
              <br></br>
              {errors.email && (
                <span className={'errors'}>{errors.email}</span>
              )}
            </div>
            <br></br>
            <div>
              <label className={"text"}>CPF</label>
              <br></br>
              <Field name="cpf" type="text" />
              <br></br>
              {errors.cpf && (
                <span className={'errors'}>{errors.cpf}</span>
              )}
            </div>
            <br></br>
            <div>
              <label className={"text"}>CRM</label>
              <br></br>
              <Field name="crm" type="text" />
              <br></br>
              {errors.crm && (
                <span className={'errors'}>{errors.crm}</span>
              )}
            </div>
            <br></br>
            <div>
              <label className={"text"}>Especialização</label>
              <br></br>
              <Field name="specialization" type="text" />
              <br></br>
              {errors.specialization && (
                <span className={'errors'}>{errors.specialization}</span>
              )}
            </div>
            <br></br>
            <div>
              <label className={"text"}>Telefone</label>
              <br></br>
              <Field name="phoneOne" type="text" />
              <br></br>
              {errors.phoneOne && (
                <span className={'errors'}>{errors.phoneOne}</span>
              )}
            </div>

            <br></br>
            <div>
              <label className={"text"}>Senha</label>
              <br></br>
              <Field name="password" type="password" />
              <br></br>
              {errors.password && (
                <span className={'errors'}>{errors.password}</span>
              )}
            </div>
            <Button color='btn--primary' buttonSize='btn--large' disabled={!isValid}>Enviar</Button>
          </Form>
        )}
      />

    </div>
  );
}
